●素材：粒状活性炭・中空糸膜（ポリエチレン）。●使用時単品サイズ（mm）：105×105×217mm。●使用時単品サイズ重量（g）：698g。●除去項目：2項目。●素材交換目安（1日10L使用の場合）：12ヶ月（1日80L使用の場合）。●遊離残留塩素（除去率80％）：900L。●濁り（ろ過流量50％）：900L。●カートリッジ対応本体品番：UB201。 ●大容量スタンダードタイプ。 ●※水道水の飲用基準に適した水でご使用下さい。温泉水・井戸水など異物を多く含む水にはご使用になれません。カートリッジは定期的に交換して下さい。浄水側へは35℃以上の温水を通さないで下さい。原水やシャワー側に60℃以上のお湯を通さないで下さい。観賞魚用などには使用しないで下さい。硬水を軟水に変えることは出来ません。<style type="text/css">
