●浄水能力:JIS　13項目除去。●初期搭載カートリッジ品番:MKC.MXJ。●初期搭載カートリッジ交換目安:600L(1日10L使用で2ヶ月)。●カートリッジ交換お知らせ機能:見え窓。●おすすめ機能:節水。●水流:原水シャワー/ストレート・浄水シャワー。●ろ過流量:1.6L/分。●ろ材の種類:活性炭・中空糸フィルター・イオン交換体。●外形寸法(mm):高×幅×奥=94×135×64。●製造元:東レ株式会社　トレビーノ販売部。 ●安心の13項目クリア。高除去タイプ。●原水シャワーに30%節水機能を搭載。●キッチンすっきり「コンパクトボディ」。[除去できる物質]遊離残留塩素、カビ臭(2-MIB)、濁り、総トリハロメタン、農薬(CAT)、テトラクロロエチレン、トリクロロエチレン、溶解性鉛、111-トリクロロエタン、クロロホルム、ブロモジクロロメタン、ジブロモクロロメタン、ブロモホルム。 ●水道水の水質基準に合格した水をお使いください。●ろ材の交換時期の目安は、使用水量、水質、水圧により異なります。●蛇口の先端にプラスチックの断熱キャップがついている場合、水栓の種類や状態によっては、取付部や水栓、配管から水もれが発生することがあります。●取付け出来ない蛇口がありますのでご注意ください(例:シャワー付蛇口・センサー付蛇口・変形蛇口など)。●ご不明な点がございましたら、取付け前に水栓メーカー・品番をご確認の上、トレビーノ・サービスセンターにご相談ください。[お問い合わせ先]トレビー<style type="text/css">
